import React from "react";
import "../style/login.css";
import { useState , useRef } from "react";
import { Link } from "react-router-dom";

const Signup = () => {
  let [current, setCurrent] = useState(1);

  const slidePage = useRef(null);
  const bullet = useRef([]);
  const progressCheck = useRef([]);
  const progressText = useRef([]);

  const handleNext = (margin) => {
    slidePage.current.style.marginLeft = margin;
    if (current >= 1 && current <= bullet.current.length) {
      bullet.current[current - 1].classList.add("active");
      progressCheck.current[current - 1].classList.add("active");
      progressText.current[current - 1].classList.add("active");
      setCurrent(current + 1);
    } else {
      console.log("Invalid current value:", current);
    }
  };

  const handleSubmit = () => {
    if (current >= 1 && current <= bullet.current.length) {
      bullet.current[current - 1].classList.add("active");
      progressCheck.current[current - 1].classList.add("active");
      progressText.current[current - 1].classList.add("active");
      setCurrent(current + 1);
      setTimeout(function () {
        alert("Your Form Successfully Signed up");
      }, 800);
    } else {
      console.log("Invalid current value:", current);
    }
  };

  const handlePrev = (margin) => {
    slidePage.current.style.marginLeft = margin;
    if (current >= 1 && current <= bullet.current.length) {
      bullet.current[current - 2].classList.add("active");
      progressCheck.current[current - 2].classList.add("active");
      progressText.current[current - 2].classList.add("active");
      setCurrent(current - 1);
    } else {
      console.log("Invalid current value:", current);
    }
  };

  return (
    <div class="container">
      <header>Signup Form</header>
      <div class="progress-bar">
        <div class="step">
          <p ref={progressText}>Name</p>
          <div ref={bullet} class="bullet">
            <span>1</span>
          </div>
          <div ref={progressCheck} class="check fas fa-check"></div>
        </div>
        <div class="step">
          <p ref={progressText}>Contact</p>
          <div ref={bullet} class="bullet">
            <span>2</span>
          </div>
          <div ref={progressCheck} class="check fas fa-check"></div>
        </div>
        <div class="step">
          <p ref={progressText}>Birth</p>
          <div ref={bullet} class="bullet">
            <span>3</span>
          </div>
          <div ref={progressCheck} class="check fas fa-check"></div>
        </div>
        <div class="step">
          <p ref={progressText}>Submit</p>
          <div ref={bullet} class="bullet">
            <span>4</span>
          </div>
          <div ref={progressCheck} class="check fas fa-check"></div>
        </div>
      </div>
      <div class="form-outer">
        <form action="#">
          <div  ref={slidePage} class="page slide-page">
            <div class="title">Basic Info:</div>
            <div class="field">
              <div class="label">First Name</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Last Name</div>
              <input type="text" />
            </div>
            <div class="field">
              <button onClick={() => handleNext("-25%")} class="firstNext next">
                Next
              </button>
            </div>
          </div>
          <div class="page">
            <div class="title">Contact Info:</div>
            <div class="field">
              <div class="label">Email Address</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Phone Number</div>
              <input type="Number" />
            </div>
            <div class="field btns">
              <button onClick={() => handlePrev("0%")} class="prev-1 prev">
                Previous
              </button>
              <button onClick={() => handleNext("-50%")} class="next-1 next">
                Next
              </button>
            </div>
          </div>
          <div class="page">
            <div class="title">Date of Birth:</div>
            <div class="field">
              <div class="label">Date</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Gender</div>
              <select>
                <option>Male</option>
                <option>Female</option>
                <option>Other</option>
              </select>
            </div>
            <div class="field btns">
              <button onClick={() => handlePrev("-25%")} class="prev-2 prev">
                Previous
              </button>
              <button onClick={() => handleNext("-75%")} class="next-2 next">
                Next
              </button>
            </div>
          </div>
          <div class="page">
            <div class="title">Login Details:</div>
            <div class="field">
              <div class="label">Username</div>
              <input type="text" />
            </div>
            <div class="field">
              <div class="label">Password</div>
              <input type="password" />
            </div>
            <div class="field btns">
              <button onClick={() => handlePrev("-50%")} class="prev-3 prev">
                Previous
              </button>
              <button onClick={handleSubmit} class="submit">
                Submit
              </button>
            </div>
          </div>
        </form>
        <div className="a">already have an acount? <Link to="/login">Login</Link></div>
      </div>
    </div>
  );
};
export default Signup;
